import MotionHoc from "./MotionHoc";
import styled from "styled-components";
const Section = styled.div`
  background-image: url('https://images.unsplash.com/photo-1533986690673-c50390c01cfa?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80');
  color: black;
  height: 100vh;
  width: 100%;
  background-size: cover;
  background-position: 30% 40%;
`;

const HomeComponent = () => {
  return <Section>
          <h1>Skov.</h1>
        </Section>;
};

const Home = MotionHoc(HomeComponent);

export default Home;
